var deviceType;
function detectDevice() {

    deviceType = 1;

    if (Modernizr.mq('(max-width: 639px)')) {
        deviceType = 4;
    }

    if (Modernizr.mq('(max-width: 767px)')) {
        deviceType = 3;
    }
    if (Modernizr.mq('(min-width: 768px) and (max-width: 979px)')) {
        deviceType = 2;
    }


}

